    'legal.item.14' => 'Fuero',
    'legal.text.1' => '<b>1. Deber de la información.</b> En cumplimiento con el deber de información recogido en el artículo 10 de la Ley 34/2002 de 11 de julio, de Servicios de la Sociedad de la Información y el Comercio Electrónico y el artículo 4, apartado Cuatro de la Ley 56/2007, de 28 de diciembre, de Medidas de Impulso de la Sociedad de la Información, a continuación se reflejan los siguientes datos: MEDIASET ESPAÑA COMUNICACIÓN, S.A., CIF: A-79075438 e inscrita en el  Registro Mercantil de Madrid, Tomo 9361 general, 8129 de la sección 3ª del Libro de Sociedades, Folio 12 hoja número 87152/2, inscripción 1ª (en adelante, \'MEDIASET ESPAÑA`), con domicilio social en Madrid, Ctra. Fuencarral a Alcobendas, n º 4, 28049 de Madrid, es titular de un portal en Internet accesible en la url  <a href="http://www.mediaset.es/mediasat">http://www.mediaset.es/mediasat</a> (en adelante \'la Web\'), cuya gestión y explotación está encomendada a Conecta 5 Telecinco, S.A.U. (en adelante, “Conecta 5”) con CIF A-82432279 y domicilio en Ctra. Fuencarral a Alcobendas, n º 4, 28049 de Madrid.',
    'legal.text.2' => '<b>2. Descripción de Servicios.</b> Conecta 5 ofrece a través de dicha Web <b>diversos contenidos</b> y servicios (en adelante, los \'Servicios\') cuya prestación queda condicionada a la aceptación plena e incondicional por el destinatario de los mismos de todas y cada una de las presentes Condiciones Generales, lo que constituye condición imprescindible para poder participar en cualquiera de los Servicios existentes o que se creen o pongan a disposición en el futuro. La utilización de la Web atribuye la condición de usuario e implica la aceptación de todos los términos y Condiciones Generales descritos.',
    'legal.text.3' => '<b>3. Normativa aplicable.</b> Las presentes Condiciones Generales <b>no constituyen toda la normativa aplicable a los Servicios</b>. En concreto, Conecta 5 podrá ofrecer o prestar Servicios a través de la Web que estén sujetos a sus propias condiciones particulares, en cuyo caso las mismas serán comunicadas a los usuarios con anterioridad. La participación en cada una de las actividades o la recepción de los servicios sujetos a Condiciones Particulares será en todo caso prueba de la íntegra y total aceptación de éstas. En estos supuestos, las Condiciones Generales se aplicarán en todo aquello no esté regulado en las condiciones particulares y que no resulte contradictorio.',
    'legal.text.4' => '<b>4. Requisitos.</b> Para <b>participar</b> en las actividades y Servicios de la Web es necesario tener 18 años y cumplir con los requisitos que se exijan en cada caso.',
    'legal.text.5' => '<b>5. Exención de responsabilidad.</b> Conecta 5 <b>no garantiza la calidad, exactitud, fiabilidad, corrección, integridad o moralidad de los datos, programas, informaciones u opiniones</b>, cualquiera que sea su origen, que circulen por su red o por las redes a las que el usuario de la Web pueda acceder a través de ésta. El usuario declara y garantiza que mantendrá exenta de toda responsabilidad por estos conceptos a Conecta 5. En consecuencia, el usuario asume bajo su exclusiva responsabilidad las consecuencias, daños o acciones que pudieran derivarse del acceso a dichos contenidos así como de su reproducción o difusión.',
    'legal.text.6' => '<b>6. Infracciones.</b> Conecta 5 no será responsable de las infracciones realizadas por <b>cualquier</b> usuario de la Web que afecten a cualquier otro usuario de la misma, o a terceros, incluyendo las que se refieran a derechos de propiedad intelectual, copyrights, marcas, patentes, información confidencial y/o cualquier otro derecho de propiedad intelectual o industrial. Asimismo, tampoco responderá de las infracciones de un usuario a la intimidad personal, honor y/o propia imagen de otro usuario o de un tercero, que serán responsabilidad exclusiva del infractor, ya se trate de afirmaciones vertidas en foros, opiniones del usuario o materiales audiovisuales aportados por éste. El usuario acepta su responsabilidad y las consecuencias derivadas de la infracción de estas normas, obligándose a mantener indemne a Conecta 5 de cualquier reclamación por este motivo.',
    'legal.text.7' => '<b>7. Derechos de Autor.</b> El usuario de la Web reconoce y acepta que los elementos y utilidades integrados dentro de ésta están protegidos por la legislación sobre derechos de autor, de propiedad intelectual e industrial, por lo que la titularidad de éstos corresponde en exclusiva a Conecta 5. En particular, el usuario declara y garantiza que conoce que no está autorizado para reproducir, comunicar, distribuir ni transformar contenidos incluidos en la Web sin el previo consentimiento expreso de Conecta 5. En caso contrario, las consecuencias de la infracción de esta obligación recaerán única y exclusivamente sobre el usuario infractor.',
    'legal.text.8' => '<b>8. Limitaciones de uso.</b></br></br>El usuario se obliga a no utilizar los servicios ofrecidos por Conecta 5 para la realización de actividades contrarias a la ley, a la moral, al orden público y, en general, a hacer un uso conforme a las presentes condiciones. Se obliga asimismo a no realizar actividades publicitarias o de explotación comercial y a no remitir ningún tipo de mensaje utilizando una identidad falsa, así como a no camuflar en manera alguna el origen del mensaje ni a remitir publicidad no solicitada.</br></br>En caso de que Conecta 5 descubriera, bien de forma directa o a través de notificaciones o requerimientos de terceros, la existencia de contenidos que pudieran infringir la legalidad vigente, las presentes condiciones, las normas de funcionamiento de la Web o la utilización de las mismas con fines fraudulentos o ilícitos y/o no autorizados por los presentes términos legales, Conecta 5 se reserva el derecho de actuar sobre los contenidos aportados por el usuario de que se trate, sin necesidad de autorización previa, mediante la eliminación de dichos contenidos infractores o cualquier otra medida que considere necesaria para evitar la continuidad en la comisión del ilícito o de la infracción detectada. Idéntica medida será aplicable en caso de que se detecte una utilización que, por sus características tales como tamaño, formato o similares, dificulten el funcionamiento de la Web.',
    'legal.text.9' => '<b>9. Cancelación de Servicios y contenidos.</b> Conecta 5 se reserva el <b>derecho de cancelar</b> en cualquier momento y sin responsabilidad alguna cualquiera de los Servicios ofrecidos a través de la Web.',
    'legal.text.10' => '<b>10. Privacidad y protección de datos de carácter personal.</b> A los efectos de la Ley Orgánica 15/1999, de 13 de diciembre, de Protección de Datos de Carácter Personal, y en virtud de su artículo 5, se informa a los usuarios de la Web de que los datos de carácter personal recabados a través de formularios puestos a su disposición en la Web, serán incluidos en un fichero de datos de carácter personal, titularidad de Conecta 5 debidamente declarado ante la AEPD.</br></br>La finalidad de dicho fichero son las siguientes: (i) posibilitar la gestión de solicitudes de participación en iniciativas comerciales sobre productos y servicios, (ii) realizar avisos, para lo que se podrán utilizar, entre otros, medios como el correo electrónico y el teléfono móvil, y (iii) llevar a cabo acciones informativas, tanto en nombre de las empresas del MEDIASET ESPAÑA (Mediaset España Comunicación, S.A., Publiespaña, S.A.U, Publimedia Gestión SAU, Sogecable Editorial, S.L., Premiere Megaplex SAU, Grupo Editorial Tele5, S.A.U., y Mediacinco Cartera, S.L.) como en nombre de terceros. </br></br>Conecta 5, con domicilio en Madrid, Ctra. de Fuencarral a Alcobendas, 4, como responsable del mencionado fichero garantiza el ejercicio de los derechos de acceso, rectificación, cancelación y oposición de los datos facilitados y se compromete, a la utilización de los datos incluidos en el mismo, a respetar su confidencialidad y a utilizarlos de acuerdo con su finalidad, referidas en el apartado anterior. Para el ejercicio de estos derechos el interesado deberá dirigirse por escrito a Conecta 5 Telecinco, S.A.U., Carretera de Fuencarral a Alcobendas, 4 (28049 Madrid), indicando \'Sección Usuarios\', o a través de la página de registro o a través de  este correo mediasat@mediaset.es  </br></br>El almacenamiento de los datos proporcionados por los usuarios se realiza de conformidad con todas las garantías de seguridad exigidas por la legislación vigente y, en especial, por el Real Decreto 1720/2007, de 21 de diciembre, por el que se aprueba el Reglamento de medidas de seguridad de ficheros automatizados que contengan datos de carácter personal.',
    'legal.text.11' => '<b>11. Modificaciones de las Condiciones Generales.</b> Conecta 5 se reserva el <b>derecho a modificar</b> en cualquier momento las presentes Condiciones Generales y a su anulación, comprometiéndose a comunicar las nuevas condiciones o anulación definitiva, en su caso.',
    'legal.text.12' => '<b>12. Responsabilidad del usuario.</b> El usuario será responsable frente a cualquier posible reclamación, derivada del incumplimiento por su parte de cualesquiera de las manifestaciones del presente documento, y se compromete a indemnizar a Conecta 5 y al resto de sociedades del Grupo MEDIASET ESPAÑA por cualquier incumplimiento de las garantías otorgadas.',
    'legal.text.13' => '<b>13. Prospección Comercial.</b> En cumplimiento de <b>la ley 34/2002</b>, le informamos de que se podrán utilizar sus datos de contacto para el envío de prospección comercial de Conecta 5, Grupo MEDIASET ESPAÑA así como de terceros, salvo que expresamente lo desautorice remitiendo la solicitud de baja de servicios de prospección comercial a esta dirección de correo electrónico robinson@mediaset.es.',
    'legal.text.14' => '<b>14. Fuero.</b> Si se produjese cualquier <b>diferencia</b> entre las partes en lo que se refiere a la interpretación, cumplimiento y efectos de estas Condiciones Generales, siempre que no se llegue a un acuerdo aceptado por ambas partes para resolverla, las partes se someten a la jurisdicción de los juzgados y tribunales de Madrid capital, renunciando expresamente a cualquier otro fuero que pudiera corresponderles.</br></br>Se entenderá que el acceso o la mera utilización de la Web por parte del Usuario implica la adhesión de éste a las condiciones generales que Conecta5 tenga publicadas en cada momento en el que acceda a la Web y que estarán disponibles para los usuarios. En consecuencia, el Usuario debe leer atentamente estas condiciones generales. </br></br>En este sentido, se entenderá por Usuario a la persona que acceda, navegue o utilice los servicios de la Web.',
